import React from 'react'
import { food_list } from '../../assets/assets'
const Context = () => {
  return (
    <div className='food1'>
        <h2>Top dishes near you</h2>
        {
            food_list.map((item,index)=>{
                return(
                    <div>  
                    <img src={item.image} />
                    <h5>{item.name}</h5>
                    <p>{item.description}</p>
                    <h4> Price:{item.price}-/</h4>
                    </div>
                  
                )
            })
        }
    </div>
  )
}

export default Context
